path::Path::to_path_buf.doc:
Converts a `Path` to an owned [`PathBuf`].

# Examples

```
use std::path::{Path, PathBuf};

let path_buf = Path::new("foo.txt").to_path_buf();
assert_eq!(path_buf, PathBuf::from("foo.txt"));
```

